from app import api
from flask_restx import Api, Resource, fields

signup_details = api.model('signup_details', {
    'username': fields.String(required=True, example='testSignup'),
    'password': fields.String(required=True, example='abcd'),
    'email': fields.String(required=True, example='test123@signUp.com')
})

login_details = api.model('login_details', {
    'username': fields.String(required=True, example='testSignup'),
    'password': fields.String(required=True, example='abcd'),
})

auth_details = api.parser().add_argument('Authorization', help="Your Authorization Token in the form 'Token "
                                                               "<AUTH_TOKEN>'", location='headers')

token_details = api.model('token_details', {
    'token': fields.String()
})

user_update_details = api.model('user_update_details', {
    'username': fields.String(example='updateUser', required=True),
    'email': fields.String(example='update@test123.com', required=True),
    'password': fields.String(example='5678', required=True)
})

user_details = api.model('user_details', {
    'id': fields.Integer(min=0),
    'username': fields.String(example='testUser'),
    'email': fields.String(example='test123@test123.com'),
    'following': fields.List(fields.Integer(min=0)),
    'followed_num': fields.Integer(min=0),
    'recipes': fields.List(fields.Integer(min=0))
})

comment_details = api.model('comment_details', {
    'author': fields.String(example='testUser'),
    'published': fields.String(example='1539476785.0'),
    'comment': fields.String(example='cool'),
})

recipe_details = api.model('recipe_details', {
    'id': fields.Integer(min=0),
    'author': fields.String(example='testUser'),
    'name': fields.String(example='Germany pork skewers'),
    'ingredients': fields.List(fields.String(example='pork belly')),
    'proportion': fields.List(fields.String(example='400g')),
    'method': fields.List(fields.String(example='mix up all dry species')),
    'published': fields.String(),
    'likes': fields.List(fields.Integer()),
    'src': fields.String(),
    'thumbnail': fields.String(),
    'comments': fields.Nested(comment_details),
    'meal_type': fields.String(example='BBQ'),
    'liked_num': fields.Integer(min=0)
})

recipe_id_details = api.model('recipe_id_details', {
    'id': fields.Integer()
})

new_recipe_details = api.model('new_recipe_details', {
    'name': fields.String(example='Germany pork skewers'),
    'ingredients': fields.List(fields.String(example='pork belly')),
    'proportion': fields.List(fields.String(example='400 gram')),
    'method': fields.List(fields.String(example='mix all dry species up')),
    'src': fields.String(required=True,
                         example='''
                         '''),
    'meal_type': fields.String(example='BBQ')
})

new_comment_details = api.model('new_comment_details', {
    'comment': fields.String(example='I love this recipe!')
})
